insert into pages_description (pages_id, language_id, pages_title, pages_body) values ('7', '2', 'Preguntas Frecuentes', '<SPAN style=\"FONT-SIZE: 8pt; COLOR: gray; FONT-FAMILY: \'Verdana\',\'sans-serif\'\"><SPAN class=EC_estilo61><SPAN style=\"COLOR: gray\">
insert into pages_description (pages_id, language_id, pages_title, pages_body) values ('6', '2', 'Nosotros', '<P>
insert into pages_description (pages_id, language_id, pages_title, pages_body) values ('8', '2', 'Confidencialidad', '<P><SPAN style=\"FONT-SIZE: 8.5pt; COLOR: #848282; FONT-FAMILY: \'Verdana\',\'sans-serif\'\"><STRONG><FONT color=#666666>Datos personales y confidencialidad</FONT></STRONG></SPAN><SPAN style=\"FONT-SIZE: 8.5pt; COLOR: #848282; FONT-FAMILY: \'Verdana\',\'sans-serif\'\"><BR><BR><FONT color=#666666>Para realizar sus compras en nuestra tienda o acceder a determinados servicios, deberá registrar sus datos personales y elegir una contraseña que le permitirá acceder a todas aquellas zonas que requieran una identificación previa. Esto evitará que, en lo sucesivo, tenga que volver a cumplimentarlos. <BR><BR>En el momento en que usted se registra en nuestro servidor seguro o realiza un pedido, sólo sus datos personales, nunca su tarjeta de crédito, son incorporados a nuestra base de datos, utilizándose únicamente para tramitar el pedido, así como para enviar información sobre ofertas y servicios que puedan resultar de su interés. <BR><BR>En cualquier momento podrá modificar los datos de su registro de socio o darse de baja en la</FONT><FONT color=#666666> </FONT></SPAN><FONT color=#666666><SPAN style=\"FONT-SIZE: 8.5pt; COLOR: gray; FONT-FAMILY: \'Verdana\',\'sans-serif\'\"><FONT color=#666666>dirección de e-mail</FONT> </SPAN><SPAN style=\"FONT-SIZE: 8.5pt; COLOR: gray; FONT-FAMILY: \'Verdana\',\'sans-serif\'\"><A href=\"mailto:clientes@topstar.es\">clientes@topstar.es</A> </SPAN></FONT></P>
